#include <stdio.h>
#include <stdlib.h>
#include <string.h>

#define TAM 100000000

typedef struct {
    char tipo, garbage;
    struct Celula *direita, *esquerda;
}Celula;

typedef struct {
    char *tipo;
    struct Argumento *direita, *esquerda, *proximo;
}Argumento;

Celula heap[TAM];
Celula *free_list;
Celula *end_heap;
Celula *raiz;
Argumento *pilha;

void alocar_memoria(){
    //heap = (Celula*) calloc(100, sizeof(Celula));
    int i;
    for(i = 0; i < TAM-1;i++)
        (heap+i)->direita = (heap+i+1);
    free_list = heap;
    end_heap = heap+TAM;
    raiz = NULL;
}

Celula* alocar_celula(char tipo){
    Celula *alocado = free_list;
    free_list = free_list->direita;
    alocado->direita = 0;
    alocado->tipo = tipo;
    return alocado;
}

