void resolver_argumentos(){
    int qnt;
    do{
        Argumento *aux = pilha;
        char *nova_entrada = aux->tipo;
        if(nova_entrada[0] == '(')
            nova_entrada = remove_parenteses(nova_entrada);
        Argumento *dir = transformar_entrada_grafo(nova_entrada);
        free(aux->tipo);
        (*aux).tipo = (*dir).tipo;
        (*aux).esquerda = (*dir).esquerda;
        (*aux).direita = (*dir).direita;
        removePilha();
    }while(pilha);
}

